import React, { useState } from "react";
import { Form, FormGroup } from "react-bootstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

const AppointmentReservation = () => {
  const [doctorName, setDoctorName] = useState(" ");
  const [dateLower, setDateLower] = useState(new Date());
  const [dateUpper, setDateUpper] = useState(new Date());

  return (
    <div>
      <Form style={{ width: "350px" }}>
        <FormGroup>
          <input
            type="text"
            onChange={(event) => setDoctorName(event.target.value)}
            placeholder="Doctor name"
            name="doctorName"
          ></input>
        </FormGroup>
        <FormGroup>
          <DatePicker
            selected={dateLower}
            onChange={(date) => setDateLower(date)}
            dateFormat="yyyy/MM/dd"
          />
        </FormGroup>
        <FormGroup>
          <DatePicker
            selected={dateUpper}
            onChange={(date) => setDateUpper(date)}
            dateFormat="yyyy/MM/dd"
          />
        </FormGroup>

        <div class="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="doctor"
            id="doctor"
          />
          <label class="form-check-label" for="doctor">
            Prioritise doctor
          </label>
        </div>
        <div class="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="time"
            id="time"
            checked
          />
          <label class="form-check-label" for="time">
            Prioritise date
          </label>
        </div>
      </Form>
    </div>
  );
};

export default AppointmentReservation;
